Looping Results with an External API Call and findOneAndUpdate<p>I am trying to write a program that gets the documents from a mongo database with mongoose and process them using an API and then edits each document in the database with the results of the processing. My problem is that I have problems because I don't understand completely nodejs and the asynchronous. This is my code:</p>

<pre><code>Model.find(function (err, tweets) {
    if (err) return err;
    for (var i = 0; i &lt; tweets.length; i++) {
        console.log(tweets[i].tweet);
        api.petition(tweets[i].tweet)
            .then(function(res) {
                TweetModel.findOneAndUpdate({_id: tweets[i]._id}, {result: res}, function (err, tweetFound) {
                    if (err) throw err;
                    console.log(tweetFound);
                });
            })
            .catch(function(err) {
                console.log(err);
            })
    }
})
</code></pre>

<p>The problem is that in the findOneAndUpdate, tweets is undefined so it can't find that id. Any solution? Thanks</p>

