group with lookup's foreign field in mongodb<p>I have two different models:</p>

<ul>
<li>Promotions</li>
<li>Tags</li>
</ul>

<p>Each promotion has a field with a reference to a tag ID. That was referenced on my schema and works fine:</p>

<pre><code>const PromotionSchema = mongoose.Schema({
    tags: { type: mongoose.Schema.Types.ObjectId, ref: 'Tag' }
}, { collection: 'promotions' });
</code></pre>

<p>My question is how to create a custom response that group all the promotions by tag? Something like this:</p>

<pre><code>{ 
   "tag": {
     "_id": "999",
     "value": "Lorem Ipsum"
   },
   "promotions": [{
      "_id": "0001",
      "value": "Value of promotion Nº1"
   },
   {
      "_id": "0002",
      "value": "Value of promotion Nº2"
   },
    ... And the others that have the same Tag ID assigned
   ]}
}
</code></pre>

<p>Right now, I'm getting all the promotions and filtering using Vanilla Javascript. I need to know how to improve this using Mongoose.</p>

