nested exception is java.lang.RuntimeException: 
org.mongodb.morphia.mapping.MappingException: 
No usable constructor for com.example.model.Item
</code></pre>

<p>It seems that when using immutable objects, I need to annotate using @BsonCreator however that doesn't appear to be working and I believe that might be because using this annotation requires me to somehow configure <code>org.bson.codecs.pojo.Conventions#ANNOTATION_CONVENTION</code>. Maybe I'm blind but i can't seem to find any examples anywhere on how to configure this. Any help would be greately appreciated. Here is my annotated POJO:</p>

<pre><code>@Value /* Lombok auto generates getters */
