Go Convert type when marshaling to json<p>My question is very similar to <a href="https://stackoverflow.com/questions/9452897/how-to-decode-json-with-type-convert-from-string-to-float64-in-golang">this one</a>, however instead of converting a <code>float64</code> to a <code>string</code> which is handled using the <a href="https://golang.org/pkg/encoding/json/#Marshal" rel="nofollow noreferrer">string tag</a>.  In my case I'm trying to convert a <a href="https://godoc.org/github.com/mongodb/mongo-go-driver/bson/objectid#ObjectID" rel="nofollow noreferrer"><code>ObjectID</code></a> to a string using it's <a href="https://godoc.org/github.com/mongodb/mongo-go-driver/bson/objectid#ObjectID.Hex" rel="nofollow noreferrer"><code>.Hex()</code></a> method.  And, vice versa using the <a href="https://godoc.org/github.com/mongodb/mongo-go-driver/bson/objectid#FromHex" rel="nofollow noreferrer"><code>.FromHex()</code></a> function on the way back.</p>

<p>However, more generically how do I convert from type <code>X</code> to type <code>Y</code> &amp; back during the <code>Marshal</code> &amp; <code>Unmarshal</code>ing?</p>

<p>My Example:</p>

<pre><code>package main

import (
    "log"
    "fmt"
    "encoding/json"
    "github.com/mongodb/mongo-go-driver/bson/objectid"
)

type Greeting struct {
    Id          *objectid.ObjectID  `json:"id"`
    Greeting    string              `json:"greeting,omitempty"`
}


func main() {
    // Create ObjectID
    id, err := objectid.FromHex("5b14dd20f6418c8443a5ffec")
    if err != nil { log.Fatal(err) }

    // Create Greeting
    g := Greeting{&amp;id, "Hello, World!"}

    // Marshal to json
    j, err := json.Marshal(g)
    if err != nil { log.Fatal(err) }

    // Print Json
    fmt.Printf("Json: %s", string(j))

}
</code></pre>

<p>Output:</p>

<pre><code>Json: {"id":[91,20,221,32,246,65,140,132,67,165,255,236],"greeting":"Hello, World!"}
</code></pre>

<p>Whereas, what I'd like is:</p>

<pre><code>Json: {"id":"5b14dd20f6418c8443a5ffec","greeting":"Hello, World!"}
</code></pre>

